/****************************************************************************
 * function 명 : lfn_Search_Set  
 * 내용        : 인수심사결재 - 조회 후 setting
 ****************************************************************************/
scwin.lfn_Search_Set = function() {
    var sPlanProgRankCd = Ds_LTIDA00.getCellData(0, "sPlanProgRankCd");
    var SpclPartDsasSbcvrYn = DsWs_PrdAttr.getCellData(0, "SpclPartDsasSbcvrYn");
    var sApplPlanCd = Ds_LTIDA00.getCellData(0, "sApplPlanCd");
    var sGdCd = Ds_LTIDA00.getCellData(0, "sGdCd");

    // 인수요청이면서, 건강보험일때만 부담보 버튼 활성화.
console.log(   sPlanProgRankCd+":"+ SpclPartDsasSbcvrYn+":"+nfn_checkAuthByID( "ds_code", util.getGdsValue("gUserID"), "22040"));
    if ((sPlanProgRankCd == "52") && 
        (SpclPartDsasSbcvrYn == "Y") && 
        (nfn_checkAuthByID( "ds_code", util.getGdsValue("gUserID"), "22040") == true)) {
        //장기인수
        btn_Sbcvr.setDisabled(false);
    } else {
        btn_Sbcvr.setDisabled(true);
    }

    // 채널구분 set.
    if (Ds_LTIDA00.getCellData(0, "sScanObjtYn") == "Y") {
        edt_sScanObjtYn.setValue("대면");
    } else {
        edt_sScanObjtYn.setValue("비대면");
    }

    if (sGdCd == "2312" && sApplPlanCd == "02") {
        // The-K 운전자보험(1707) & 간편심사플랜인 경우
	    Edit8.setStyle( "background-color" , "red" );
	    Edit8.setStyle( "font-weight" , "Bold" );
    }
	if(sGdCd == "2313" && sApplPlanCd == "02") { // 2018 상품개정
	    Edit8.setStyle( "background-color" , "red" );
	    Edit8.setStyle( "font-weight" , "Bold" );
	}    
};

