/****************************************************************************
 * function 명 : btn_JugmCarr_OnClick  
 * 내용        : 심사이력조회 버튼
 ****************************************************************************/
scwin.btn_JugmCarr_OnClick = function(e) {
    var promise = Promise.resolve();

    var pi_nRow = -1;//util.nvl(Tab_step1.Ds_LTIDA00.getRowPosition(), -1 ) ;

    //var arg;
    if (pi_nRow < 0) {
        pi_nRow = 0;
    }
    //arg = "sInrpsCd=" + wconv.quote(Ds_LTIDA00.getCellData(pi_nRow, "sInrpsCd")); //피보험자코드
    //arg += " sCrtorCd=" + wconv.quote(Ds_LTIDA00.getCellData(pi_nRow, "sCrtorCd"));
    promise = promise.then(function(rtnVal) {
    	var sArgs = {"sInrpsCd" : Ds_LTIDA00.getCellData(pi_nRow, "sInrpsCd")
    	                 ,"sCrtorCd" : Ds_LTIDA00.getCellData(pi_nRow, "sCrtorCd")
    	                 ,"sOnlySrarch":sOnlySrarch};
    	var pObj = {"Ds_LTIDA00":Ds_LTIDA00,
    	                 "DsWs_PrdAttr":DsWs_PrdAttr,
    	                 "Ds_Pibo":Tap_UdrtkJugm_contents_Tap_UdrtkJugm_Tab_step1_body.getWindow().Ds_Pibo};                 
    	var popInfo = {"width":1290,//854,
    	                     "height":580,//617,
    	                     "indata":sArgs,
    	                     "parentObject":pObj,
    	                     "title":"인수심사결재_심사이력조회"
    	                     };
        //계약자주민번호
        //return wprom.popupOpen("/ui/cbsc/CBSC160P.xml",popInfo);
        return wprom.windowOpen("/ui/cbsc/CBSC160P.xml",popInfo);
    });

    return promise;
};

