console.log("sjobName : "+	Ds_Pibo.getCellData(0, "sjobName"));         
    if (Ds_Pibo.getRowCount() > 0) {
        //arg = "sRow=" + wconv.quote(wconv.toString(0));
        promise = promise.then(function(rtnVal) {
        	var sArgs = {"sRow"  : "0" };
        	var pObj = {
        		"Ds_Pibo":Ds_Pibo,
        		"Ds_LTIDA00":Ds_LTIDA00
        	};
        	var popInfo = {
   			    "title" : "피보험자 누적", 
				"width" : 1110,
				"height" : 674,
				"indata":sArgs,
				"parentObject":pObj        	
        	};
            //Ds_Pibo SEQ
            //return wprom.popupOpen("/ui/cbsc/CBSC128P.xml", popInfo); 
            return wprom.windowOpen("/ui/cbsc/CBSC128P.xml", popInfo);
        });
    } else {
        wprom.alert("피보험자 정보가 없습니다.");
        return;
    }

    return promise;
};

