/****************************************************************************
 * function 명 : lfn_Check_Validation
 * 내용        : 필수 입렵 체크
 ****************************************************************************/
scwin.lfn_Check_Param = function(obj) {
    var bResult = true;
    var rMsg = "";
    var objRtn = obj.split("^");
    var icpsId = objRtn[0];
    var icpsPw = objRtn[1];
    if (icpsId == "" || icpsId == null) {
        bResult = false;
        rMsg = "ICPS 사용자 ID";
    } else if (icpsPw == "" || icpsPw == null) {
        bResult = false;
        rMsg = "ICPS 비밀번호";
    }
    if (!bResult) {
        wprom.alert(rMsg + "가 입력되지 않았습니다.");
    }
    return bResult;
};

