scwin.btn_KCIS_OnClick = function(obj) {
	return;
    var sLoginKey = scwin.selectKCIS0200100();
    var url;
    //운영환경일 때 Y  아니면 N 
    if (gds.gProdYN == "Y") {
        url = "https://ins.kcredit.or.kr/?loginKey=";
    } else {
        url = "https://insdev.kcredit.or.kr/?loginKey=";
    }
    wconv.trace("URL : " + url + sLoginKey);
    ExecBrowser(url + sLoginKey);
};

