};

scwin.btn_a300_OnClick = function(obj) {

    var promise = Promise.resolve();
    var pi_nRow = util.nvl(Tab_step1.Ds_LTIDA00.getRowPosition(),-1);
    var arg;
    if (pi_nRow < 0) {
        pi_nRow = 0;
    }
    arg = "sInrpsCd=" + wconv.quote(Ds_LTIDA00.getCellData(pi_nRow, "sInrpsCd"));
    promise = promise.then(function(rtnVal) {
        //피보험자코드
        return wprom.popupOpen("/ui/cbsc/CBSC140M.xml", arg, 820, 612); /*wprom.popupOpen(가이드참조)*/
    });
    return promise;
};

scwin.lfn_OnUnloadCompleted = function(obj) {
    wconv.clear(DsWs_updateJudge);
    wconv.clear(DsWs_updateJudgeWarning);

    SOBJ_Judge.WSDL = gds.gWsdlBasis;
    var MethodObj = SOBJ_Judge.CreateMethodObj("perform");
    setHeader("Ds_SaveJudge", "com.inswave.longterm.ssr.sst.task.DBB170Task", "saveJudge");
    Ds_SaveJudge.removeAll();
    var insRow = util.insertRow(Ds_SaveJudge, 0);
    /*수작업 변환 개발자 가이드(테스트 중)
    dataList에 row를 추가하고 setCellData를 하는 경우 첫 번째 인자를 insRow로 변경해주세요.*/
    Ds_SaveJudge.setCellData(0, "sJudgeEmpNo", "");
    Ds_SaveJudge.setCellData(0, "sPlanNo", sPlanNo);
    addDocumentData(Ds_SaveJudge);
    setTail("Ds_SaveJudge");
    SOBJ_Judge.CreateObj("in0");
    MethodObj.in0 = insertStr;
    var result = gfn_CallService(SOBJ_Judge, DOBJ_SaveJudge, MethodObj); //trace(insertStr);
    /*
    if(DsWs_updateJudgeWarning.GetCount() != 0) {
    	alert(DsWs_updateJudgeWarning.GetColumn(0, "msg"));
    } else {
    	alert("정상 처리되었습니다.");
    }
    */
};
